import { Appointment } from './Appointment.model';
import { Allergy } from './Allergy.model';
import { Prescription } from './Prescription.model';

export class Patient {
    id: string =""
    personId: string =""
    allergies: Allergy[] =[];
    appointments: Appointment[] =[];
    prescriptions: Prescription[] =[];
    
  }
